import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  height: 753px;
  background-color: #f7f8fa;
  width: 100%;
  padding-top: 82px;
  box-sizing: border-box;
  & > .container {
    display: flex;
    & > .left {
      & > figure {
        width: 122px;
        height: 122px;
      }
      & > .tag {
        font-size: 20px;
        font-weight: bold;
        color: #007fff;
      }
      & > .title {
        font-size: 42px;
        font-weight: bold;
        font-family: "cafe24";
        line-height: 1.33;
        color: #191f28;
      }
      & > .sub {
        font-size: 18px;
        font-weight: 500;
        line-height: 1.61;
        color: #191f28;
      }
    }
  }
`;

function Section3() {
  return (
    <Wrapper>
      <div className="container">
        <div className="left">
          <figure>
            <img src="/assets/main/section2/man.svg" alt="" />
          </figure>
          <div className="tag">뭉치 알림톡 쇼핑</div>
          <div className="title">
            카카오 알림톡으로 <br /> 우리 동네 가게 <br /> 온라인 쇼핑
          </div>
          <div className="sub">
            별도의 앱 개발/배포/설치/인증과정 없이 <br /> 오직 카카오 알림톡
            발송만으로 간편하게! <br /> 우리 동네 가게 온라인 쇼핑은 뭉치와
            함께하세요.
          </div>
          <div className="bottom">알림톡 건당 10원 앱 결제시 수수료 발생</div>
        </div>
        <div className="right"></div>
      </div>
    </Wrapper>
  );
}

export default Section3;
